import React, { Component } from 'react';
import './App.css';
import { Table, Container } from 'react-bootstrap';
import {userCrud} from './UserCrud'

const users =[];
class Visualizacao extends Component {

  render() {
    console.log(userCrud);
    return (
      <div>
        <div>
          <Container>
            <Table striped bordered hover>
              <thead>
                <tr>
                  <th>ID</th>
                  <th>NOME</th>
                  <th>CIDADE</th>
                  <th>IDADE</th>
                </tr>
              </thead>
              <tbody>
                {users.filter(
                  (valores, index) => index >= 0 && index < 10)
                  .map((item, indice) =>
                    <tr key={indice}>
                      <td>{item.id}</td>
                      <td>{item.nome}</td>
                      <td>{item.cidade}</td>
                      <td>{item.idade}</td>
                    </tr>
                  )}
              </tbody>
            </Table>
          </Container>
        </div>
      </div >
    )
  }
}
export default (Visualizacao);
